<#

Extract the existing standard emojis by opening the emoji picker, and then
using this script to process all the available standard emojis.
Copy the output and paste it further below in this script.

(async () => {
    const task = async (func) => {
        return new Promise(async (resolve) => {
            if (!func || typeof func === 'number') {
                setTimeout(() => resolve(), func || 1);
                return;
            }
            try {
                const value = await func();
                setTimeout(() => resolve(value), 1);
            }
            catch (e) {
                setTimeout(() => resolve(e), 1);
            }
        });
    };
    await task(() => document.querySelector('[class*="unicodeShortcut"]').click());
    await task(() => document.querySelector('[class*="categoryItem"][aria-label="people"]')?.click());
    const nonNumberRegExp = /[^\-\d\.\, ]/g;
    const scroller = document.querySelector('[class*="emojiPickerList"] [class*="scroller"]');
    const db = [];
    const visited = [];
    const assets = [];
    const next = async () => {
        scroller.querySelectorAll('[class*="emojiItem"]').forEach((el) => {
            if (visited.includes(el)) return;
            visited.push(el);
            const { name, surrogates } = el.dataset;
            if (db.find(o => o.name === name)) {
                console.warn('Duplicate', name, surrogates);
                return;
            }
            const image = el.querySelector('[class*="emojiSpriteImage"]');
            if (!image) {
                console.warn('Image', name, surrogates);
                return;
            }
            const { backgroundImage, backgroundPositionX, backgroundPositionY } = image.style;
            const url = backgroundImage.match(/([^"]+.png)/)[1];
            const x = parseInt(backgroundPositionX.replaceAll(nonNumberRegExp, ''));
            const y = parseInt(backgroundPositionY.replaceAll(nonNumberRegExp, ''));
            const alias = el.querySelector('[class*="hiddenVisually"]')?.textContent.trim().split(' ');
            db.push({ name, surrogates, url, x, y, alias });
            if (!assets.includes(url)) assets.push(url);
        });
        const prev = scroller.scrollTop;
        scroller.scrollBy(0, 128);
        await task();
        return prev !== scroller.scrollTop;
    };
    while (await next()) {}
    const output = { assets, db };
    console.warn(JSON.stringify(output));
    return output;
})();

