'@

# makes it easier to fine-tune lua related output but keep the image as-is
$SKIP_ASSET_EXTRACTION = $true

Add-Type -AssemblyName System.Drawing

function Get-DiscordEmoteImages() {
    param(
        [string]$Url,
        [int]$Size = 80
    )
    $temp = "$([System.IO.Path]::GetTempFileName()).png"
    Invoke-WebRequest -Uri $Url -OutFile $temp
    $bitmap = [System.Drawing.Bitmap]::FromFile($temp)
    $cols = $bitmap.Width / $Size
    $rows = $bitmap.Height / $Size
    $data = @{}
    $count = 0
    $rect = $null
    $emoteBitmap = $null
    "Extracting images from a $($cols) by $($rows) grid ($($Url)) ..." | Out-Host
    for ($y = 0; $y -lt $rows; $y++) {
        for ($x = 0; $x -lt $cols; $x++) {
            if ($SKIP_ASSET_EXTRACTION) {
                if (-not $rect -or -not $emoteBitmap) {
                    $rect = [System.Drawing.Rectangle]::new($x * $Size, $y * $Size, $Size, $Size)
                    $emoteBitmap = $bitmap.Clone($rect, $bitmap.PixelFormat)
                }
            }
            else {
                $rect = [System.Drawing.Rectangle]::new($x * $Size, $y * $Size, $Size, $Size)
                $emoteBitmap = $bitmap.Clone($rect, $bitmap.PixelFormat)
            }
            if (-not $data[$x]) {
                $data[$x] = @{}
            }
            $data[$x][$y] = $emoteBitmap
            $count++
        }
    }
    $bitmap.Dispose()
    Remove-Item -Path $temp
    return $data, $count
}

function New-EmptyImage() {
    param(
        [int]$Total,
        [int]$Size
    )
    $cols = [math]::Ceiling([math]::Sqrt($Total))
    $rows = [math]::Ceiling($Total / $cols)
    $canvasWidth = $cols * $Size
    $canvasHeight = $rows * $Size
    $nearestPowerOf2 = {
        param($value)
        $power = [math]::Ceiling([math]::Log($value, 2))
        return [math]::Pow(2, $power)
    }
    $canvasWidth = & $nearestPowerOf2 $canvasWidth
    $canvasHeight = & $nearestPowerOf2 $canvasHeight
    $canvasSize = if ($canvasWidth -gt $canvasHeight) { $canvasWidth } else { $canvasHeight }
    $canvasSize = [int]$canvasSize
    $bitmap = New-Object System.Drawing.Bitmap $canvasSize, $canvasSize
    $image = [System.Drawing.Graphics]::FromImage($bitmap)
    $image.InterpolationMode = [System.Drawing.Drawing2D.InterpolationMode]::HighQualityBicubic
    $image.SmoothingMode = [System.Drawing.Drawing2D.SmoothingMode]::AntiAlias
    $image.CompositingQuality = [System.Drawing.Drawing2D.CompositingQuality]::HighQuality
    $image.Clear([System.Drawing.Color]::Transparent)
    return $bitmap, $image, $canvasSize
}

"Processing $($output.Length) bytes of raw data ..." | Out-Host

$outputData = $output | ConvertFrom-Json -AsHashtable

"Processing $($outputData.assets.Count) assets ..." | Out-Host

$assets = @{}
$totalAssets = 0

foreach ($asset in $outputData.assets) {
    $assetBitmaps, $assetCount = Get-DiscordEmoteImages -Url "https://discord.com$($asset)"
    $assets[$asset] = $assetBitmaps
    $totalAssets += $assetCount
}

"Processing $($outputData.db.Count) emojis ($($totalAssets) individual assets) ..." | Out-Host

$totalImageEmojiSize = 32
$totalBitmap, $totalImage, $totalImageSize = New-EmptyImage -Total $totalAssets -Size $totalImageEmojiSize
$totalRow = 0
$totalCol = -1
$totalImageEmojiSize = 40 # manually increased to better utilize the available space
$emojis = @()

foreach ($item in $outputData.db) {
    $asset = $assets[$item.url]
    $row = [int]($item.x / -40)
    $col = [int]($item.y / -40)
    $emoteBitmap = $asset[$row][$col]
    if (++$totalCol * $totalImageEmojiSize + $totalImageEmojiSize -ge $totalImageSize) {
        $totalCol = 0;
        $totalRow++;
    }
    $x = $totalCol * $totalImageEmojiSize
    $y = $totalRow * $totalImageEmojiSize
    $totalImage.DrawImage($emoteBitmap, $x, $y, $totalImageEmojiSize, $totalImageEmojiSize)
    if (-not $SKIP_ASSET_EXTRACTION) {
        $emoteBitmap.Dispose()
    }
    $emojis += @{
        name    = $item.name;
        alias   = $item.alias;
        unicode = $item.surrogates;
        size    = $totalImageEmojiSize;
        x       = $x;
        y       = $y;
    }
}

if ($SKIP_ASSET_EXTRACTION) {
    foreach ($asset in $assets.Values) {
        $asset[0][0].Dispose()
    }
}

$lua = @()
$lua += "local CEL = LibStub and LibStub(`"ChatEmotesLib-1.0`", true)"
$lua += "if not CEL then return end"
$lua += ""
$lua += "local emotes = {}"
$lua += ""
$lua += "emotes[`"Standard`"] = {"
foreach ($emoji in $emojis) {
    $name = $emoji.alias[0]
    $alias = if ($emoji.alias.Count -gt 1) { ", alias = { `"$($emoji.alias[1..$emoji.alias.Count])`" }" } else { "" }
    $unicode = $emoji.unicode
    # $unicode = if ($unicode.Length -gt 2) { "" } else { $unicode }
    $unicode = if ($unicode.Length -gt 0) { ", unicode = `"$($unicode)`"" } else { "" }
    $offsetL = $emoji.x / $totalImageSize
    $offsetR = ($emoji.x + $emoji.size) / $totalImageSize
    $offsetT = $emoji.y / $totalImageSize
    $offsetB = ($emoji.y + $emoji.size) / $totalImageSize
    $lua += "`t{ name = `"$($name)`"$($alias), file = `"Discord`", fileWidth = $($totalImageSize), fileHeight = $($totalImageSize), offsetL = $($offsetL), offsetR = $($offsetR), offsetT = $($offsetT), offsetB = $($offsetB)$($unicode) },"
}
$lua += "}"
$lua += ""
$lua += "local packageName, addonName = `"Discord`", ..."
$lua += ""
$lua += "CEL.RegisterPackage({"
$lua += "`tname = packageName,"
$lua += "`tpath = format(`"Interface/AddOns/%s/emotes`", addonName),"
$lua += "`temotes = emotes,"
$lua += "})"
$lua -join "`r`n" | Out-File "core.lua"

if (-not $SKIP_ASSET_EXTRACTION) {
    $outputPathPNG = Join-Path -Path "." -ChildPath "emotes.png"
    $totalBitmap.Save($outputPathPNG, [System.Drawing.Imaging.ImageFormat]::Png)
    BLPPNG $outputPathPNG
    $outputPathBLP = $outputPathPNG.Replace(".png", ".blp")
    $destinationPath = Join-Path "." -ChildPath "emotes/Standard/Discord.blp"
    Move-Item -Path $outputPathBLP -Destination $destinationPath -Force
    Remove-Item -Path $outputPathPNG
}

$totalBitmap.Dispose()
$totalImage.Dispose()

"Done!" | Out-Host
